CREATE TABLE IF NOT EXISTS "migrations" ("id" integer primary key autoincrement not null, "migration" varchar not null, "batch" integer not null);
CREATE TABLE IF NOT EXISTS "users" ("id" integer primary key autoincrement not null, "first_name" varchar not null, "middle_name" varchar, "last_name" varchar not null, "birthdate" date not null, "email" varchar not null, "phone_number" varchar not null, "bio" text not null, "avatar" text not null, "email_verified_at" datetime, "password" varchar not null, "remember_token" varchar, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "password_reset_tokens" ("email" varchar not null, "token" varchar not null, "created_at" datetime, primary key ("email"));
CREATE TABLE IF NOT EXISTS "sessions" ("id" varchar not null, "user_id" integer, "ip_address" varchar, "user_agent" text, "payload" text not null, "last_activity" integer not null, primary key ("id"));
CREATE TABLE IF NOT EXISTS "cache" ("key" varchar not null, "value" text not null, "expiration" integer not null, primary key ("key"));
CREATE TABLE IF NOT EXISTS "cache_locks" ("key" varchar not null, "owner" varchar not null, "expiration" integer not null, primary key ("key"));
CREATE TABLE IF NOT EXISTS "async_jobs" ("id" integer primary key autoincrement not null, "queue" varchar not null, "payload" text not null, "attempts" integer not null, "reserved_at" integer, "available_at" integer not null, "created_at" integer not null);
CREATE TABLE IF NOT EXISTS "async_job_batches" ("id" varchar not null, "name" varchar not null, "total_jobs" integer not null, "pending_jobs" integer not null, "failed_jobs" integer not null, "failed_job_ids" text not null, "options" text, "cancelled_at" integer, "created_at" integer not null, "finished_at" integer, primary key ("id"));
CREATE TABLE IF NOT EXISTS "async_failed_jobs" ("id" integer primary key autoincrement not null, "uuid" varchar not null, "connection" text not null, "queue" text not null, "payload" text not null, "exception" text not null, "failed_at" datetime not null default CURRENT_TIMESTAMP);
CREATE TABLE IF NOT EXISTS "employers" ("id" integer primary key autoincrement not null, "name" varchar not null, "industry" varchar not null, "website" varchar, "email" varchar not null, "phonenumber" varchar not null, "description" text not null, "type" varchar not null, "number_of_employees" integer not null, "logo" text, "password" varchar not null, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "jobs" ("id" integer primary key autoincrement not null, "employer_id" integer not null, "title" varchar not null, "salary" varchar not null, "location" varchar not null, "employment_type" varchar not null default 'Full Time', "urgent_hiring" tinyint(1) not null default '0', "description" text not null, "created_at" datetime, "updated_at" datetime, foreign key("employer_id") references "employers"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "tags" ("id" integer primary key autoincrement not null, "name" varchar not null, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "job_tag" ("id" integer primary key autoincrement not null, "job_id" integer not null, "tag_id" integer not null, "created_at" datetime, "updated_at" datetime, foreign key("job_id") references "jobs"("id") on delete cascade, foreign key("tag_id") references "tags"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "user_addresses" ("id" integer primary key autoincrement not null, "user_id" integer not null, "street" varchar not null, "barangay" varchar not null, "city" varchar not null, "province" varchar not null, "zip_code" varchar not null, "created_at" datetime, "updated_at" datetime, foreign key("user_id") references "users"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "employer_addresses" ("id" integer primary key autoincrement not null, "employer_id" integer not null, "street" varchar not null, "barangay" varchar not null, "city" varchar not null, "province" varchar not null, "zip_code" varchar not null, "created_at" datetime, "updated_at" datetime, foreign key("employer_id") references "employers"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "admins" ("id" integer primary key autoincrement not null, "name" varchar not null, "email" varchar not null, "password" varchar not null, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "applications" ("id" integer primary key autoincrement not null, "user_id" integer not null, "job_id" integer not null, "status" varchar not null, "cover_letter" varchar, "resume" text not null, "created_at" datetime, "updated_at" datetime, foreign key("user_id") references "users"("id") on delete cascade, foreign key("job_id") references "jobs"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "queued_job_batches" ("id" varchar not null, "name" varchar not null, "total_jobs" integer not null, "pending_jobs" integer not null, "failed_jobs" integer not null, "failed_job_ids" text not null, "options" text, "cancelled_at" integer, "created_at" integer not null, "finished_at" integer, primary key ("id"));
CREATE TABLE IF NOT EXISTS "notifications" ("id" varchar not null, "type" varchar not null, "notifiable_type" varchar not null, "notifiable_id" integer not null, "data" text not null, "read_at" datetime, "created_at" datetime, "updated_at" datetime, primary key ("id"));
CREATE TABLE IF NOT EXISTS "imports" ("id" integer primary key autoincrement not null, "completed_at" datetime, "file_name" varchar not null, "file_path" varchar not null, "importer" varchar not null, "processed_rows" integer not null default '0', "total_rows" integer not null, "successful_rows" integer not null default '0', "user_id" integer not null, "created_at" datetime, "updated_at" datetime, foreign key("user_id") references "users"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "failed_import_rows" ("id" integer primary key autoincrement not null, "data" text not null, "import_id" integer not null, "validation_error" text, "created_at" datetime, "updated_at" datetime, foreign key("import_id") references "imports"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "exports" ("id" integer primary key autoincrement not null, "completed_at" datetime, "file_disk" varchar not null, "file_name" varchar, "exporter" varchar not null, "processed_rows" integer not null default '0', "total_rows" integer not null, "successful_rows" integer not null default '0', "user_type" varchar not null, "user_id" integer not null, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "work_experiences" ("id" integer primary key autoincrement not null, "user_id" integer not null, "employer_id" integer, "company_name" varchar not null, "job_title" varchar not null, "location" varchar not null, "start_date" date not null, "end_date" date, "is_current" tinyint(1) not null, "description" text, "created_at" datetime, "updated_at" datetime, foreign key("user_id") references "users"("id") on delete cascade, foreign key("employer_id") references "employers"("id") on delete set null);
CREATE TABLE IF NOT EXISTS "education" ("id" integer primary key autoincrement not null, "user_id" integer not null, "school_name" varchar not null, "degree" varchar not null, "field_of_study" varchar, "start_year" integer not null, "end_year" integer, "is_current" tinyint(1) not null, "academic_level" varchar not null, "created_at" datetime, "updated_at" datetime, foreign key("user_id") references "users"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "reviews" ("id" integer primary key autoincrement not null, "employer_id" integer not null, "user_id" integer not null, "rating" integer not null, "comment" text, "is_approved" tinyint(1) not null default '1', "created_at" datetime, "updated_at" datetime, foreign key("employer_id") references "employers"("id") on delete cascade, foreign key("user_id") references "users"("id") on delete cascade);
CREATE UNIQUE INDEX "users_email_unique" on "users" ("email");
CREATE INDEX "sessions_user_id_index" on "sessions" ("user_id");
CREATE INDEX "sessions_last_activity_index" on "sessions" ("last_activity");
CREATE INDEX "queued_jobs_queue_index" on "async_jobs" ("queue");
CREATE UNIQUE INDEX "queued_failed_jobs_uuid_unique" on "async_failed_jobs" ("uuid");
CREATE UNIQUE INDEX "tags_name_unique" on "tags" ("name");
CREATE UNIQUE INDEX "admins_email_unique" on "admins" ("email");
CREATE INDEX "notifications_notifiable_type_notifiable_id_index" on "notifications" ("notifiable_type", "notifiable_id");
CREATE INDEX "exports_user_type_user_id_index" on "exports" ("user_type", "user_id");

